from collections import Counter


class Solution:
    def balancedString_build_up(self, s: str) -> int:
        limit = len(s) // 4
        count = Counter()
        # marker
        red = Counter()
        for i in s:
            count.setdefault(i, 0)
            if count[i] < limit:
                count[i] += 1
            else:
                red.setdefault(i, 0)
                red[i] += 1
        if len(count) == 1:
            return 3 * limit
        elif len(red) == 0:
            return 0
        # acc count
        count.clear()
        pairs = list(filter(lambda x: x[1] in red, enumerate(s)))
        res = len(s)
        n = len(pairs)
        left_idx = 0
        for right, e in pairs:
            count[e] += 1
            while left_idx < n and all(count[e] >= red[e] for e in red):
                res = min(res, right - pairs[left_idx][0] + 1)
                count[pairs[left_idx][1]] -= 1
                left_idx += 1
        return res

    def balancedString_tear_down(self, s: str) -> int:
        res = n = len(s)
        limit = n // 4
        left = 0
        count = Counter(s)
        for right, e in enumerate(s):
            count[e] -= 1
            while left < n and left <= right + 1 and all(limit >= count[c] for c in count):
                res = min(res, right - left + 1)
                count[s[left]] += 1
                left += 1
        return res


if __name__ == "__main__":
    s = ""
